// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './pages/Home';
import RenewableEnergyDirectory from './pages/RenewableEnergyDirectory';
import RenewableEnergy from './pages/RenewableEnergy';
import EducationalResources from './pages/EducationalResources';
import CommunityProjects from './pages/CommunityProjects';
import Contacts from './pages/Contacts';
import AboutUs from './pages/AboutUs';
import './App.css'; // Add your styles here

const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/renewable-energy-directory" element={<RenewableEnergyDirectory />} />
          <Route path="/renewable-energy" element={<RenewableEnergy />} />
          <Route path="/educational-resources" element={<EducationalResources />} />
          <Route path="/community-projects" element={<CommunityProjects />} />
          <Route path="/contacts" element={<Contacts />} />
          <Route path="/about-us" element={<AboutUs />} />
        </Routes>
      </div>
    </Router>
  );
};

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <Link to="/">Logo</Link>
      </div>
      <button className="navbar-toggle" onClick={toggleMenu}>
        <span className="navbar-toggle-icon"></span>
        <span className="navbar-toggle-icon"></span>
        <span className="navbar-toggle-icon"></span>
      </button>
      <ul className={`navbar-links ${isOpen ? 'active' : ''}`}>
        <li><Link to="/renewable-energy-directory">Renewable Energy Directory</Link></li>
        <li><Link to="/renewable-energy">Renewable Energy</Link></li>
        <li><Link to="/educational-resources">Educational Resources</Link></li>
        <li><Link to="/community-projects">Community Projects</Link></li>
        <li><Link to="/contacts">Contacts</Link></li>
        <li><Link to="/about-us">About Us</Link></li>
      </ul>
    </nav>
  );
};

export default App;
